    "contracts/BabyFarm.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity ^0.8.20;
import "@openzeppelin/contracts/interfaces/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract BabyFarm is IERC20, Ownable {
    using SafeMath for uint256;

    string private _name = "Baby Farm";
    string private _symbol = "BFT";
    uint8 private _decimals = 18;

    mapping(address => bool) public _isPair;
    mapping(address => uint256) internal _balances;
    mapping(address => mapping(address => uint256)) internal _allowances;

    uint256 internal _totalSupply = 100000000000 * 10 ** 18; // 100B supply

    mapping(address => bool) isExcludedFromFee;
    mapping(address => bool) public blackListed;

    uint256 public _buy = 4; //  4%
    uint256 public _sell = 7; // 7%
    address public taxReceiver; // paste tax receiver here

    uint256 public inbetweenFee = 0; // 0%
    uint256 public _buyTotal;
    uint256 public _sellTotal;
    uint256 public _inbetweenFeeTotal;

    constructor() Ownable() {
        isExcludedFromFee[taxReceiver] = true;
        isExcludedFromFee[address(this)] = true;
        _balances[_msgSender()] = _totalSupply; //this line compromises the supply of fund's

        emit Transfer(address(0), taxReceiver, _totalSupply);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function transfer(
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(
        address owner,
        address spender
    ) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(
        address spender,
        uint256 amount
    ) public override returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            msg.sender,
            _allowances[sender][msg.sender].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) private {
        require(
            !blackListed[sender],
            "Sender is blacklisted, cannot transfer Gen tokens."
        );
        require(
            !blackListed[recipient],
            "Recipient is blacklisted, cannot receive Gen tokens."
        );
        require(sender != address(0), "ERC20: Transfer from the zero address");
        require(recipient != address(0), "ERC20: Transfer to the zero address");

        uint256 taxedAmount = amount; // Initialize taxedAmount with the original amount

        // Deduct tax from sender's balance
        if (!isExcludedFromFee[sender] && _isPair[sender]) {
            uint256 taxToPay = (amount * _buy) / 100;
            _balances[taxReceiver] = _balances[taxReceiver].add(taxToPay);
            taxedAmount = taxedAmount.sub(taxToPay);
        }

        // Add tax to recipient's balance
        if (!isExcludedFromFee[recipient] && _isPair[recipient]) {
            uint256 taxToPay = (amount * _sell) / 100;
            _balances[taxReceiver] = _balances[taxReceiver].add(taxToPay);
            taxedAmount = taxedAmount.sub(taxToPay);
        }

        // Deduct taxed amount from sender's balance
        _balances[sender] = _balances[sender].sub(amount);

        // Add taxed amount to recipient's balance
        _balances[recipient] = _balances[recipient].add(taxedAmount);

        emit Transfer(sender, recipient, amount);
    }

    /**
      This function will be used for add any address in blacklist (if you want to block any address like bots etc)
    */

    function addInBlackList(address account, bool) public onlyOwner {
        blackListed[account] = true;
    }

    /**
     This function will be used for remove any address from blacklist 
    */
    function removeFromBlackList(address account, bool) public onlyOwner {
        blackListed[account] = false;
    }

    /** 
       This function will be used for checking any address in blacklist or not 
    */
    function isBlackListed(
        address _address
    ) public view returns (bool _blacklisted) {
        if (blackListed[_address] == true) {
            return true;
        } else {
            return false;
        }
    }

    //function to add pair;
    function addPair(address _pairAddress) public onlyOwner {
        require(!_isPair[_pairAddress], "already added as a pair");
        _isPair[_pairAddress] = true;
    }

    //function to remove pair
    function removePair(address _pairAddress) public onlyOwner {
        require(_isPair[_pairAddress], "pair not found");
        _isPair[_pairAddress] = false;
    }

    //function to change tax reciever;
    function changeTaxReciever(address _newReciever) public onlyOwner {
        require(_newReciever != taxReceiver, "address already a tax reciever");
        taxReceiver = _newReciever;
    }

    //function to set buy tax
    function _setBuyTax(uint256 buy) public onlyOwner {
        require(buy != 10, "tax can't be greater than 10%");
        _buy = buy;
    }

    //function for sell tax
    function _setSellTax(uint256 sell) public onlyOwner {
        require(sell != 10, "tax can't be greater than 10%");
        _sell = sell;
    }
}
"
    }
